import logo from "./logo.svg";
import "./App.css";

import Typing from "./component/Typing";
import Dialog from "./component/Dialog";

import React, { Component } from "react";

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      result: {},
    };
  }
  getResult = (childData) => {
    this.setState({
      result: childData,
    });
  };
  render() {
    return (
      <div className="App">
        <div className="container">
          <Typing result={this.getResult()} />
          <Dialog result={this.sate.result} />
        </div>
      </div>
    );
  }
}
